import Foundation

/*
 55. Jump Game
 Medium

 Given an array of non-negative integers, you are initially positioned at the first index of the array.

 Each element in the array represents your maximum jump length at that position.

 Determine if you are able to reach the last index.

 Example 1:

 Input: [2,3,1,1,4]
 Output: true
 Explanation: Jump 1 step from index 0 to 1, then 3 steps to the last index.
 Example 2:

 Input: [3,2,1,0,4]
 Output: false
 Explanation: You will always arrive at index 3 no matter what. Its maximum
 jump length is 0, which makes it impossible to reach the last index.
 */

class Solution {

    /*
     Approach - Recursion

     By using recusion, we can inspect each fork check. Unfortunately, it can get quite expensive with both
     large numbers as well as lenthy inputs.

     That being said, we may be able to optimize with a memoized lookup storage? Meaning if we start from a given place
     to solve once, we don't have to iterate over that sequence again.

     The memoization approach works well with lengthy data, but performs poorly with all 1's because of the likelier
     chance to Copying portions of the input array multiple times. In this case, it may be better to pass around an
     inout number array in favor of attempting to work with ranges rather than the large array.

     Although this works locally well, it does not fit LeetCode's machine limits. The limits provided apepar to
     have a memory limitation, likely given the numerous sub array copies or memoized reference growth for large
     collections. Given these restrictions at may be better to perform this with pointer logic, which loses the
     potential for memoization.
     */

    private func canJump(_ nums: [Int], memoizedReference: inout [[Int]: Bool]) -> Bool {
        // Sentinel Success
        if nums.count == 1 {
            return true
        }

        // Sentinel Fail (Jumped Passed the end)
        guard let first = nums.first else {
            return false
        }

        // Zero is a dead position
        guard first > 0 else {
            return false
        }

        // Default Success to Fail
        var success = false

        // Inspect all permutation jumps from current position
        // Reverse possible options to identify largest jump possible first
        for offset in (1...first).reversed() {

            // If invalid, items behind it will be invalid, break loop/fail
            guard let validIndex = nums.index(0,
                                              offsetBy: offset,
                                              limitedBy: nums.endIndex - 1)
                else {
                    continue
            }

            // Determine potential Suffix to try
            let potentialSuffix = Array(nums[validIndex...])

            // If a known failure suffix, no need to recurse to find out it failed
            if memoizedReference[potentialSuffix] == false {
                continue
            }

            // Inspect if we are able to make it to the end by inspecting calculated suffix
            if canJump(potentialSuffix,
                       memoizedReference: &memoizedReference) {
                success = true
                break
            } else {
                // Cache known failure
                memoizedReference[potentialSuffix] = false
            }
        }
        return success
    }

    func canJump(_ nums: [Int]) -> Bool {
        var memoizedReference = [[Int]: Bool]()
        return canJump(nums, memoizedReference: &memoizedReference)
    }
}

// Suggested approach by @strengthen
// https://github.com/strengthen/LeetCode
// https://www.cnblogs.com/strengthen/p/9917793.html
class Solution2 {
    func canJump(_ nums: [Int]) -> Bool {
        var bestPos = 0

        var i = nums.count - 1
        while (i >= 0 ) {
            if (nums[i] + i >= bestPos) {
                bestPos = i
            }
            i -= 1
        }

        return bestPos == 0
    }
}

Solution().canJump([2,3,1,1,4]) == true
Solution().canJump([3,2,1,0,4]) == false
Solution().canJump([4,4,1,0,0,1,1]) == true

